function level = get_level(obj)
% GET_LEVEL - Gets Level property 
%
% level = get_level(obj)
%
% Where
%
% LEVEL is the level of the main title associated with report generator
% object OBJ.
%
% See also: set_level, print_title

% Description: Gets Level property 
% Documentation: class_abstract_generator.txt

level = obj.Level;

end